import './App.css';
import Content from './Content';




function App() {

  const [show, setShow] = useState(false)


  return (
    <div style={{padding: 50}}>
      <button onClick={() => setShow(!show)}>toggle</button>
      {show && <Content />}
    </div>
  )



}

export default App;
